import axios from "axios";

export default async function HandleGet(linkAPI) {
  const [data, setData] = useState({});

  axios
    .get(linkAPI)
    .then((res) => {
      setData(res);
    })
    .catch((err) => {
      const errMsg = err.response.data.message;
      console.log(errMsg);

      //   Call toastMess
    });

  return data;
}
